pragma solidity 0.6.0;

import "./LockableERC20.sol";
import "./Premine.sol";
import "./Pauseable.sol";
import "./Upgradeable.sol";

contract WrappedToken is LockableERC20, Premine, Pauseable, Upgradeable {
    event BurnWrappedToken(
        address indexed _tokenHolder,
        string _coinReceiver,
        uint _amount
    );

    constructor (
        address _initPreminter,
        address[] memory _initAdmins,
        string memory _initName,
        string memory _initSymbol
    )
        public
        LockableERC20(_initAdmins, _initName, _initSymbol)
        Premine(_initPreminter)
    {
    }

        // lockable added to origin transfer, transferFrom from uniswap sourcecode
    function transfer(
        address recipient,
        uint amount
    )
        public
        onlyNotLocked(msg.sender)
        onlyNotPaused()
        returns (bool)
    {
        _transfer(msg.sender, recipient, amount);
        return true;
    }

    function transferFrom(
        address sender,
        address recipient,
        uint amount
    )
        public
        onlyNotLocked(sender)
        onlyNotPaused()
        returns (bool)
    {
        _transferFrom(msg.sender, sender, recipient, amount);
        return true;
    }

    function mint(
        address _tokenHolder,
        uint _amount
    )
        public
        onlyAdmin(msg.sender)
        onlyNotPaused()
    {
        _mint(_tokenHolder, _amount);
    }

    function burn(
        uint _amount,
        string memory _coinReceiver
    )
        public
        onlyNotLocked(msg.sender)
        onlyNotPaused()
    {
        address sender = msg.sender;
        _burn(sender, _amount);
        emit BurnWrappedToken(sender, _coinReceiver, _amount);
    }

    function premine(
        address _tokenHolder,
        uint _amount
    )
        public
        onlyPreminter(msg.sender)
        onlyNotPreminted(_tokenHolder)
        onlyPreminting()
    {
        _isPreminted[_tokenHolder] = true;
        _mint(_tokenHolder, _amount);
        emit Premint(_tokenHolder, _amount);
    }

    function stopPremine(
    )
        public
        onlyPreminter(msg.sender)
    {
        _disablePremine();
    }

    function pause()
        public
        onlyAdmin(msg.sender)
    {
        _pause();
    }

    function unpause()
        public
        onlyAdmin(msg.sender)
        onlyNotUpgraded()
    {
        _unpause();
    }

    // DANGER
    function forcedBurn(
        address _address,
        uint _amount
    )
        public
        onlyAdmin(msg.sender)
    {
        _burn(_address, _amount);
    }

    function upgradeToken(
        address _newTokenAddress
    )
        public
        onlySuperAdmin(msg.sender)
    {
        _pause();
        _upgradeToken(_newTokenAddress);
    }

    function swapNewToken(
        address _address
    )
        public
        onlyUpgraded()
        onlyNewToken(msg.sender)
        returns(uint)
    {
        uint _amount = balanceOf(_address);
        _burn(_address, _amount);
        return _amount;
    }
}
